import './App.css';
import React, { Component } from "react"
import TodoList from './components/todolist'

class App extends Component {

  state = {
    tasks: [
      {
        id: 1,
        task: "something",
        dateB: "1/10/12",
        complete: false,
        steps: [{
          task: "something",
          dateB: "1/10/12",
          complete: false,
        }],
      }
      ,
      {
        id: 2,
        task: "something2",
        dateB: "1/10/12",
        complete: false,
        steps: [],
      }
      ,
      {
        id: 3,
        task: "something3",
        dateB: "1/10/12",
        complete: false,
        steps: [],
      }
      ,
      {
        id: 3,
        task: "something3",
        dateB: "1/10/12",
        complete: false,
        steps: [],
      }
    ]
  }


  render() {
    return (
      <div className="container">
        <TodoList todolist={this.state.tasks} />
      </div>
    );
  }
}


export default App;
